import Navbar from "../components/NavBar";
import fotocamera from "../asserts/fotocamera.jpg";

import "./msu_style.css";



export default function MobileSignUp(){
    return (
        <div className="">
            {/* <Navbar/> */}
            <div className="mobile-sign-up">
                <h1>Sign Up to Verne</h1>
               <form>
                <label >Name</label>
                <input placeholder="Name"></input>
                
                <label >Email</label>
                <input type='email' placeholder="example@domain.com"></input>
               
                <label >Password</label>
                <input type='password' placeholder="Password"></input>
                
                <button>Fast Sign Up</button>
                <div className="button-div">
                    <button>Sign Up</button>
                    <button href="/">Close</button>
                </div>
               </form>
            </div>
        </div>
    );
}
